import React from 'react';
import List from '../components/List';
import logo from './images/Rick-And-Morty-PNG-File.png';
function Home() {
  return (
    <div className="home-container">
      <img className="navbar-image" src={logo} alt="rick and morty logo image" />
      <List />
    </div>
  );
}

export default Home;
